import logo from './logo.svg';
import './App.css';
import { withCookies, useCookies } from "react-cookie";
import React, { useEffect, useState } from 'react';
import Stack from '@mui/material/Stack';
import SigninModal from './Components/Signin/SigninModal.js';
import SignupModal from './Components/Signup/SignupModal.js';
import LogoutButton from './Components/Logout/LogoutButton.js';

function Header() {
  return (
    <div className="Header">
        <Stack direction="row" spacing={2}>
          <SigninModal title={'Sign In'}/>
          <SignupModal title={'Sign Up'}/>
          <LogoutButton />
        </Stack>
    </div>
  );
}

export default Header;
